import {Link} from 'react-router-dom';
import {FaHome} from 'react-icons/fa';
import {MdComputer} from 'react-icons/md';
import {GiCircuitry} from 'react-icons/gi';
import {FcElectricity,FcElectronics} from 'react-icons/fc';
function Navmenu(){
    return (
        <div>
            <nav>
                <li>
                    <Link to='/' ><FaHome/></Link>
                </li>
                <li>
                    <Link to='/civil-page' ></Link>
                </li>
                <li>
                    <Link to='/eee-page' ></Link>
                </li>
                <li>
                    <Link to='/mech-page' ><FcElectronics /></Link>
                </li>
                <li>
                    <Link to='/ece-page' ><GiCircuitry /></Link>
                </li>
                <li>
                    <Link to='/cse-page' ><MdComputer /></Link>
                </li>
            </nav>
        </div>
    );
}
export default Navmenu;
